import React, {useState} from "react";

import LineTitle from "../Components/LineTitle"

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faCoffee, faEnvelope, faMailForward, faPhone } from '@fortawesome/free-solid-svg-icons'

function GetInTouch() {
    const [style, setStyle] = useState({display: 'none'});

    let ClickDisplay = {display:"block"};
    function ClickToDisplay() {
        if( ClickDisplay.display === "none") {
            ClickDisplay = {display:"block"};
        } else {
            ClickDisplay = {display:"none"};
        }
    }

    return(
        <div onMouseEnter={e => {
                     setStyle({display: 'block'});
                 }}
                 onMouseLeave={e => {
                     setStyle({display: 'none'})
                 }} className="Contact">
            <br></br><br></br><br></br>

            <LineTitle NoLine={true} Light={false} Title="Get In Touch!"/>
            <p style={ClickDisplay} className='DisplayContact VySmFont'>

                <a href="tel:+91-9910584860" className="SmMdFont NavBarText">
                    <FontAwesomeIcon icon={faPhone} />
                </a>

                <a className="SmMdFont NavBarText" href='mailto:dt.rashumalhotra@gmail.com'>
                    <FontAwesomeIcon icon={faEnvelope} />
                </a>             
            </p>
        </div>
    );
}

export default GetInTouch;
